import Img from './Components/Img/Img'
import Paragraph from './Components/Paragraph/Paragraph'
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
       <Img />
        <Paragraph />
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
